    render(){
        return(
            <footer>
              <div style={{ backgroundColor: '#f1f1f1',fontSize:'2em',textAlign:'center',overflow:'hidden' }}>
                <div style={{ maxWidth:'700px' }}>
                    Created with <span> </span>
                    <FontAwesome name="heart" />
                    <span> </span>
                    by WDCT
                </div>
                </div>
            </footer>

        );
    }
};


//exports
export default Footer;
